import React from 'react'

function Person() {

    const persons = [

        {
            id: 1,
            name: 'A',
            age: 10
        },

        {
            id: 2,
            name: 'B',
            age: 20
        },

        {
            id: 3,
            name: 'C',
            age: 30
        }
    ]

   
}

export default Person
